import React from "react";

export default function Attempt({ attempt }) {
    return (
        <dl className='row'>
            <dd className='col-sm-4'>Code: {attempt.password}</dd>
            <dd className='col-sm-4'>Amount of tries: {attempt.tries}</dd>
            <dd className='col-sm-4'>Time spent: {attempt.time} ms</dd>
        </dl>
    );
}
